import styled from 'styled-components';
import Toolbar from './toolbar';

const VerticalToolbar = styled(Toolbar)`
  flex-direction: column;

  .toolbar-item {
    width: 78px;
    padding: 13px 16px;
  }
`;

VerticalToolbar.displayName = 'VerticalToolbar';

export default VerticalToolbar;
